import React from 'react';
import Header from './components/Header';
import Hero from './components/Hero';
import About from './components/About';
import Skills from './components/Skills';
import Projects from './components/Projects';
import Certifications from './components/Certifications';
import Experience from './components/Experience';
import Contact from './components/Contact';
import Footer from './components/Footer';

function App() {
  return (
    <div className="App">
      {/* Navigation Header */}
      <Header />

      {/* Main Content Sections */}
      <main>
        {/* Hero Section with introduction and contact button */}
        <Hero />

        {/* About Me Section with Cloud/DevOps focus */}
        <About />

        {/* Skills Section with grouped technical skills */}
        <Skills />

        {/* Projects Section with project cards */}
        <Projects />

        {/* Certifications Section */}
        <Certifications />

        {/* Experience Section - placeholder for now */}
        <Experience />

        {/* Contact Form Section */}
        <Contact />
      </main>

      {/* Footer */}
      <Footer />
    </div>
  );
}

export default App;
